import React, { useEffect } from 'react';
import { Link, useHistory } from 'react-router-dom';
import { Container, TextField, Button, Grid } from '@mui/material';
import GoogleLogin from 'react-google-login';
import FacebookLogin from 'react-facebook-login';
import {gapi} from 'gapi-script';
import './LoginScreen.css'; // Import your CSS file for styling



const LoginScreen = () => {
  const history = useHistory();
  const clientId = '223407551839-u5p661d3dn6noi04668sf1aude820lqe.apps.googleusercontent.com';
  useEffect(() => {
    gapi.load('auth2', () => {
      gapi.auth2.init({ client_id: clientId })
    })
  }, [clientId])

    const handleGoogleLoginSuccess = (response) => {
      console.log(response);

    const userData = {
      name: response.profileObj.name,
      email: response.profileObj.email,
    };

    history.push({
      pathname: '/LoginSucess',
      state: { user: userData },
    });
  };

  const handleGoogleLoginFailure = (response) => {
    console.log(response);
  };

  const handleFacebookLogin = (response) => {
    console.log(response);
  };

  const handleFacebookLoginFailure = (response) => {
    console.log(response);
  };

  const buttonStyle = {
    backgroundColor: 'rgb(215, 56, 55)',
    color: 'white',
    marginTop: '10px',
    padding: '10px 20px',
    borderRadius: '4px',
    fontWeight: 'bold',
    cursor: 'pointer',
    width: '100%',
  };

  const socialButtonContainerStyle = {
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',
    width: '100%',
  };

  const socialButtonStyle = {
    ...buttonStyle,
    width: '48%', // Equal width for both buttons
    borderRadius: '20px', // Larger value for rounded edges
    marginTop: '10px',
  };

  return (
    <div>
      <div className="login-screen-container">
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#ff5500" fill-opacity="1" d="M0,0L48,32C96,64,192,128,288,133.3C384,139,480,85,576,80C672,75,768,117,864,138.7C960,160,1056,160,1152,160C1248,160,1344,160,1392,160L1440,160L1440,0L1392,0C1344,0,1248,0,1152,0C1056,0,960,0,864,0C768,0,672,0,576,0C480,0,384,0,288,0C192,0,96,0,48,0L0,0Z"></path></svg>
      <Container maxWidth="xs">
      <Grid container spacing={2} justifyContent="center" alignItems="center" className="login-form-container">
          <Grid item xs={12}>
            <div style={{ padding: '20px', borderRadius: '8px', boxShadow: '0px 2px 10px rgba(0, 0, 0, 0.1)' }}>
              <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', marginBottom: '20px' }}>
                {}
              </div>
              <h2 style={{ textAlign: 'center' }}>Login</h2>
              <TextField label="Email" variant="outlined" fullWidth />
              <TextField label="Senha" type="password" variant="outlined" fullWidth style={{ marginTop: '10px' }} />
              <Button variant="contained" color="secondary" fullWidth style={{ ...buttonStyle, marginTop: '20px' }}>
                Login
              </Button>
              <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: '20px' }}>
                <Link to="/cadastro" style={{ textDecoration: 'none', marginBottom: '10px', width: '100%' }}>
                <div style={socialButtonContainerStyle}>
              <GoogleLogin
                clientId="223407551839-u5p661d3dn6noi04668sf1aude820lqe.apps.googleusercontent.com"
                onSuccess={handleGoogleLoginSuccess}
                onFailure={handleGoogleLoginFailure}
                buttonText="Google"
                style={socialButtonStyle}
              />
              <FacebookLogin
                clientId="13fb2f1e94f7c31e7746297793fd5ac6"
                onSuccess={handleFacebookLogin}
                onFailure={handleFacebookLoginFailure}
                buttonText="Facebook"
                style={socialButtonStyle}
              />
            </div>
                </Link>
              </div>
            </div>
          </Grid>
        </Grid>
      </Container>
    </div>
    </div>
  );
}
export default LoginScreen;
